import React, { Component } from 'react'; 
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom'; 
import Home from './home.js'; 
import About from './about.js'; 
import Contact from './contact.js'; 
import Jobs from './RecruiterPortal.js'; 
import Accepted from './accepted.js'; 
import Rejected from './rejected.js'; 
import Candidate from './addcandidate.js';

class App extends Component { 
render() { 
	return ( 
	<Router> 
		<div > 
			
				<Link to="/rejected">rejected jobs</Link> 
			
				<Link to="/accepted">Accepted jobs</Link> 
			
				<Link to="/candidates">add candidates</Link> 
								<Link to="/jobs">rejected jobs</Link> 
			
			<Switch> 
			<Route exact path='/rejected' component={Rejected}></Route> 
			<Route exact path='/accepted' component={About}></Route> 
			<Route exact path='/candidates' component={Contact}></Route> 
			<Route exact path='/jobs' component={Contact}></Route> 
			</Switch> 
		</div> 
	</Router> 
); 
} 
} 

export default App;
